        "body": "\u4fee\u6539HLL\u6d4b\u8bd5\u6587\u4ef6, \u6ce8\u91ca\u4e0d\u652f\u6301\u7684\u547d\u4ee4\u5e76\u6dfb\u52a0\u7cbe\u5ea6\u538b\u529b\u6d4b\u8bd5.\r\n\u5206\u522b\u57285w, 10w, 15w,30w, 50w, 100w\u8bb0\u5f55\u8fdb\u884c\u6d4b\u8bd5, \u5176\u4e2d50w\u4ee5\u5185\u8bef\u5dee\u5747\u5c0f\u4e8e1%, 100w\u4ee5\u5185\u8bef\u5dee\u5c0f\u4e8e3%:\r\n\r\n*  5w \u8bef\u5dee: 0.26%\r\n*  10w \u8bef\u5dee:0.28%\r\n*  15w \u8bef\u5dee:0.37%\r\n*  30w \u8bef\u5dee:0.23%\r\n*  50w \u8bef\u5dee:0.66%\r\n*  100w \u8bef\u5dee:2.4%\r\n\r\n\u8be6\u7ec6\u6d4b\u8bd5\u7ed3\u679c:\r\n`leviathan@ubuntu:~/Documents/pika-master$ tclsh tests/test_helper.tcl --clients 1 --single` `unit/hyperloglog`\r\n\r\n`Cleanup: may take some time... OK`\r\n`Starting test server at port 11111`\r\n`[ready]: 2546`\r\n`Testing unit/hyperloglog`\r\n`Starting ----` \r\n`Before Wait`\r\n`After Wait`\r\n`[ok]: PFADD without arguments creates an HLL value`\r\n`[ok]: Approximated cardinality after creation is zero`\r\n`[ok]: PFADD returns 1 when at least 1 reg was modified`\r\n`[ok]: PFADD returns 0 when no reg was modified`\r\n`[ok]: PFADD works with empty string (regression)`\r\n`[ok]: PFCOUNT returns approximated cardinality of set`\r\n`[ok]: PFMERGE results on the cardinality of union of sets`\r\n`[ok]: PFCOUNT multiple-keys merge returns cardinality of union`\r\n`50000 error rate: 0.0026199999999999999`\r\n`100000 error rate: 0.0028900000000000002`\r\n`150000 error rate: 0.0037733333333333334`\r\n`300000 error rate: 0.0023033333333333334`\r\n`500000 error rate: 0.0066519999999999999`\r\n`1000000 error rate: 0.024093`\r\n`[ok]: HYPERLOGLOG press test: 5w, 10w, 15w, 20w, 30w, 50w, 100w`\r\n`Waiting for process 2549 to exit...`\r\n`Waiting for process 2549 to exit...`\r\n`[1/1 done]: unit/hyperloglog (1988 seconds)`\r\n                   \r\n    `The End`\r\n\r\n`Execution time of different units:`\r\n  `1988 seconds - unit/hyperloglog`\r\n`\\o/ All tests passed without errors!`\r\n`Cleanup: may take some time... OK`\r\n",
