        "author_association": "CONTRIBUTOR",
        "body": "When binlog sync or ack message lost in network, master can not receive corresponding ack message, this lead slave sent_offset is always larger than acked_offset. \r\nIn function WakeUpSlaveBinlogSync, master check sent and ack offset to read binlog to the write queue, so new binlog will never sync to slave node.\r\nWorse still, the heart beat by PikaAuxiliaryThread will always keep slave node alive, this dead slave node never sync binlog and cannot be remove by master automatically.\r\nWe add offset check in HandleBinlogSyncRequest, message lose will trigger slave node timeout, and will lead reconnect to fix this problem.",
        "closed_at": "2020-06-11T09:30:16Z",
