        "body": "This came up while trying to debug using vertx, which implements RESP2 and RESP3 and tries to issue the `hello` command to figure out which protocol to speak. Pika doesn't implement the `hello` command but also has a non-standard error message, so vertx can't connect.\r\n\r\nThis PR doesn't fix the incompatibility with vertx, but fixes a typo regarding single and double quotes.",
